
from typing import List, Tuple
class Solution: #time complexity: O(Nlog(N)); Space complexity: O(N)
     
    def merge(self, arr, mid, left, right):
        aux = []
        i  = left
        j =  mid +1
        count_r = 0
        while(i <= mid  and j  <= right):
            if arr[i][0] > arr[j][0]:                  
                count_r += 1
                aux.append(arr[j])
                j += 1
            else:
                arr[i][1] += count_r
                aux.append(arr[i])
                i += 1 
                
        while(i <= mid):
            arr[i][1] += count_r
            aux.append(arr[i])
            i +=1
        while(j <= right):
            aux.append(arr[j])
            j +=1
        for i in range(len(aux)):
            arr[left+ i] = aux[i]
            
    #main function 
    def divide(self, arr,left, right): 
        #base case:when the array has only one element
        if left <  right:
            mid = (left + right) // 2 #divide the array by 2
        #call the recursion to the left and right side in order to find the max subarray sum
            self.divide(arr, left, mid) 
            self.divide(arr, mid + 1, right)
        # find the max subarray sum that crosses the middle
            self.merge(arr, mid, left, right)
    
    #auxiliary function to LeetCode's enviroment.
    def countSmaller(self, nums: List[int]) -> List:
        n =  len(nums)
        res = []
        for i in  range(n):
            res.append([nums[i], 0, i])
        left = 0
        right = n -1
        self.divide(res, left, right)
        for i in res:
              nums[i[2]] =  i[1]
        return  nums
    
